window.bookSummaryJSON = "<p>After coming face to face with death, Elorion and company have found a dungeon to call their own. They’ve fought hard to earn a stint of peace, but Mistress Nava is still out there and her captain is now on the hunt. The impending arrival of the army of minotaurs will be the greatest threat they have faced thus far.&nbsp;</p> <p>With their new-found freedom comes a myriad of additional dangers. They’re running low on food, the dungeon is in disrepair, and they must find new hunting grounds to continue growing in power. As their chosen leader, Elorion is faced with an impossible task. Will he weaponize their dungeon, develop his party’s strengths, or seek ancient power from the long-forgotten depths of the Underworld?</p>"; 
